import { Link } from "react-router-dom";

function Main() {
  return (
    <div className=" min-h-screen min-w-full flex flex-col justify-center items-center">
      <Link to="/walletConnect">
        <button>walletConnect</button>
      </Link>
      <Link to="/home">
        <button>home</button>
      </Link>
      <Link to="/main">
        <button>main</button>
      </Link>
      <Link to="/signup">
        <button>signup</button>
      </Link>
      <Link to="/fox">
        <button>fox</button>
      </Link>
    </div>
  );
}
export default Main;
